script: |
  super -f text -I q9661.spq | sort > q9661.out

inputs:
  - name: q9661.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN col2 * + ( 71 ) + + col2 + + + ( - col2 ) - + + 85 AND - - col1;
  - name: tab1

outputs:
  - name: q9661.out
    data: |
      51	14	96
      85	5	59
      91	47	68
